import React from 'react';

const Footer = () => {
  return (
    <footer className="mastfoot mt-auto" style={{backgroundColor: "rgba(0, 0, 0, .85)"}}>
      <div className="inner">
        <p>Books and Brewskies</p>
      </div>
    </footer>
  )
}

export default Footer;
